import React, { Component } from 'react';
import '../App.css';
import Games from '../components/Games';

class Collection extends Component {

  render() {
    return (
        <div className="App-body">
            <h1>All of the Games</h1>
            <h2>View by...</h2>
            <button type="button" className="btn btn-secondary">Owner's Shelf</button>
            <button type="button" className="btn btn-secondary">Number of Players</button>
            <Games />
        </div>
    );
  }
}

export default Collection;
